import React from 'react'
import Nodes from './Nodes'

export default function Graph() {
    return (
        <div>
            <h1>Graph</h1>
            {()=>{
                for (var i=0; i<1000; i++){
                    return(
                        <Nodes />
                    )
                }
            }}
        </div>
    )
}
